import Embed from "../Project-Components/Embed.js"

import CurrentLinks from "../Project-Components/currentLinks.js";

import Header from "./Header.js"

export default function ProjectPage() {

    const { search } = useLocation();
    const query = new URLSearchParams(search);
    const name = query.get("name");
    
    return (
 
  <div>
     <Header type = {name.type} title = {"JamLink"} desc = {"View Prototype"} src = {"./content/Images-JamLink/jamLink.jpg"} link = {"https://www.figma.com/proto/MUQPWZrCKchjPh5e3rMP3R/Portfolio?node-id=205%3A7845&page-id=205%3A7683&scaling=scale-down&starting-point-node-id=205%3A9054&viewport=729%2C429%2C0.27"}/>
     <div className = "page-content">
      <div className = "content-flex">
        <CurrentLinks />
      </div>
     </div>
  </div>
    );
   
}
